import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import LoginPage from '../components/LoginPage';
import RegisterPage from '../components/RegisterPage';
import DashboardPage from '../components/DashboardPage';
import ModulePage from '../components/ModulePage';
import { Box, Package, Settings } from 'lucide-react';

const AppRouter = ({
    user,
    onLoginSuccess,
    onRegisterSuccess,
    setNotification,
    handleLogout,
    userEmail,
    currentPage,
    setCurrentPage
}) => (
    <Routes>
        {!user ? (
            <>
                <Route path="/register" element={
                    <RegisterPage
                        onRegisterSuccess={onRegisterSuccess}
                        onSwitchToLogin={() => setCurrentPage('login')}
                        setNotification={setNotification}
                    />
                } />
                <Route path="*" element={
                    <LoginPage
                        onLoginSuccess={onLoginSuccess}
                        onSwitchToRegister={() => setCurrentPage('register')}
                        setNotification={setNotification}
                    />
                } />
            </>
        ) : (
            <>
                <Route path="/dashboard" element={<DashboardPage userName={user.email} userId={user.id} />} />
                <Route path="/module1" element={<ModulePage title="Módulo 1: Gestión de Proyectos" icon={Box} />} />
                <Route path="/module2" element={<ModulePage title="Módulo 2: Análisis de Datos" icon={Package} />} />
                <Route path="/module3" element={<ModulePage title="Módulo 3: Configuración Avanzada" icon={Settings} />} />
                <Route path="*" element={<Navigate to="/dashboard" />} />
            </>
        )}
    </Routes>
);

export default AppRouter;
